// src/entities/Obstacle.js
import Matter from 'matter-js';
import React from 'react';

const Obstacle = (x, y) => {
  const obstacle = {
    body: Matter.Bodies.rectangle(x, y, 50, 50, {
      isStatic: true,
      label: 'obstacle',
      restitution: 0.5,
      friction: 0.5,
    }),
    renderer: <ObstacleRenderer />,
  };
  return obstacle;
};

const ObstacleRenderer = () => {
  const style = {
    position: 'absolute',
    width: '50px',
    height: '50px',
    backgroundImage: 'url(/assets/obstacle.png)',
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    transform: 'translate(-25px, -25px)', // Center the image
  };

  return <div style={style} />;
};

export default Obstacle;
